import React from 'react'

const Nav = () => {
  return (
    <div className='navbar navbar-dark bg-dark'>
        <div className='container-fluid d-flex justify-content-center'>
            <a className='navbar-brand' href='#'>
                <p className='fs-3'>Parent Todo</p>
            </a>
        </div>
    </div>
  )
}

export default Nav
